import React, { Component } from 'react'
class Cardcontainer extends Component {
  render() {
    const { name, alt, className } = this.props.monster
    return (
      <div className={className}>
        <img src={this.src} alt={alt} />
        <h1>{name}</h1>
      </div>
    )
  }
}

export default Cardcontainer
